INSERT INTO `comentarios` (`id`, `usuario`, `comentario`, `id_ruta`) VALUES
(1, 'Ubpub', 'Mi comentario en la ruta mirador de los poetas', 3),
(4, 'Admin', 'El administrador aprueba esta ruta con buena puntuación.', 3),
(5, 'lima', 'Espectacular, he tenido mucha suerte siendo Febrero y hemos disfrutado de un día soleado estupendo y poca nieve, alguna zona con hielo pero con cuidado sin necesidad de crampones y si con bastones. La ruta es muy fácil de seguir por lo bien indicada que está con carteles, se adivina la ruta también viendo por donde transcurre y siguiendo a la gente que siempre hay subiendo o bajando. Solo hay un \"pero\" y es que el GPS tiene muy baja señal y da fallo al seguir la ruta pero no es problema, al volver iba por encima de la ruta y me decía \"veo que estás cogiendo un atajo\"... Jajaja', 4);

