INSERT INTO `rutas` (`id`, `nombre_ruta`, `distancia`, `max_height`, `min_height`, `dificultad`, `pos_slope`, `neg_slope`, `circular`, `start_lat`, `start_lon`, `usuario`, `fecha`, `descripcion`, `puntos`) VALUES
(1, 'Ruta de los Calderones', 12.27, 1672, 1179, 'Normal', 611, 611, 1, 42.8239, -5.77881, 'Admin', '2023-01-29', 'La ruta se inicia en Piedrasecha, para tomar enseguida una vereda casi paralela al río. Destaca una gran roca silícica, muy llamativa por los líquenes amarillentos que la colonizan; es El Serrón. Pronto se llega a la fuente del Manadero y un poco más allá, la Cueva de las Palomas alberga una sencilla ermita rupestre que custodia la imagen de Nuestra Señora del Manadero. Su romería se celebra el último domingo de Julio, congregando a vecinos de toda la comarca.', ''),
(2, 'Subida al Vizcodillo', 16.39, 2104, 1199, 'Dificil', 932, 929, 1, 42.2368, -6.46165, 'Ubpub', '2022-07-07', 'A 1,5km pasando Truchillas desde Truchas hay un parking con un panel indicativo para subir al lago Truchillas,hasta el cual llego y atravieso por la salida del agua que forma el rio Truchilas, para subir a una cuota dos mil en primer lugar y acto seguido al Vizcodillo.Descenso por la laguna Malicioso hasta el coche.', ''),
(3, 'Mirador de los poetas', 11.42, 1667, 1303, 'Normal', 497, 585, NULL, 40.7707, -4.0681, 'Ubpub', '2015-03-05T08:40:55.000Z', 'Desde Madrid por la A-6 salida 47 Dirección Guadarrama cogemos una gran recta pasamos una rotonda y en la siguiente rotonda tercera salida dirección a el Puerto del León cruzamos el Pueblo y después de salir de una curva a izquierdas la segunda calle a la derecha que es la Calle Doctor Gómez Ruiz la M-622 que no la dejamos hasta llegar a Cercedilla cruzamos el túnel del tren y justo en la segunda curva tenemos un Stop.\r\nCogemos la carretera de las dehesas M-966 todo recto hasta un bifurcación que nosotros tomaremos a la derecha a la izquierda va a El hospital de La Fuenfría. Tenemos dos Parking a la derecha ó el ultimo que es muy Pequeñín justo en el último giro a la izquierda enfrente de la fuente de Majavilán; siempre tenemos un buen chorro que podemos aprovechar para llenar nuestras cantimploras.', '[[40.77075,-4.068101],[40.770776,-4.068112],[40.770781,-4.068106],[40.770798,-4.068121],[40.770797,-4.068124],[40.770797,-4.06813],[40.770797,-4.068135],[40.770796,-4.068138],[40.770801,-4.068143],[40.770804,-4.068138],[40.770805,-4.068135],[40.770803,-4.068132],[40.770802,-4.068133],[40.770808,-4.068141],[40.77081,-4.068148],[40.770807,-4.068144],[40.770817,-4.068153],[40.770832,-4.068179],[40.770839,-4.068191],[40.770864,-4.068222],[40.770867,-4.068228],[40.770884,-4.068243],[40.7709,-4.068252],[40.770904,-4.06825],[40.770906,-4.068266],[40.770922,-4.068295],[40.770925,-4.068299],[40.770935,-4.068309],[40.77095,-4.068322],[40.770998,-4.068342],[40.771023,-4.068327],[40.771,-4.068256],[40.770952,-4.068242],[40.770972,-4.068065],[40.770952,-4.068014],[40.77093,-4.068023],[40.770909,-4.068175],[40.770919,-4.068235],[40.770922,-4.068339],[40.770911,-4.068548],[40.770922,-4.068634],[40.771004,-4.068652],[40.771069,-4.068576],[40.771069,-4.068575],[40.771069,-4.06841],[40.771058,-4.06836],[40.771044,-4.068371],[40.771102,-4.068271],[40.771131