INSERT INTO `rutas` (`id`, `nombre_ruta`, `distancia`, `max_height`, `min_height`, `dificultad`, `pos_slope`, `neg_slope`, `circular`, `start_lat`, `start_lon`, `usuario`, `fecha`, `descripcion`, `puntos`) VALUES
(5, 'Desfiladero de las Xanas', 9.34, 564, 189, 'Fácil', 1574, 1574, 1, 43.2744, -5.9944, 'lima', '2015-08-25T12:34:11.000Z', 'Este desfiladero de la Cordillera Cantábrica del norte asturiano, llega a alcanzar una profundidad de hasta 80-90 metros, y tiene una longitud de alrededor de dos kilómetros de garganta tallados en la cara Oeste de los montes de la Sierra del Aramo con increíble audacia por el arroyo Viescas o de las Xanas que se dirige en su descenso encabritado en una sucesión de estratos calizos a desembocar hacia al río Trubia. Gran parte de su paseo peatonal discurre por la margen derecha del río, excavado en la roca vertical a media ladera en la montaña, bordeando espectaculares cortados y vertiginosos escenarios, se recorre de oeste a este, mediante un sendero encañonado lleno de belleza y encanto natural, dominado por un perfil rocoso en cuyo lecho yermo crecen madroños, encinas y tejos, que avanza por una sinuosa y estrecha vía que atraviesa varios puentes de madera y túneles tallados en la roca caliza, no superando en la mayoría de su trayecto los dos metros de ancho.', '[[43.274409,-5.994405],[43.274448,-5.994297],[43.274385,-5.99404],[43.274487,-5.993825],[43.274753,-5.993632],[43.27501,-5.993396],[43.27519,-5.993235],[43.275331,-5.993042],[43.275456,-5.992849],[43.27569,-5.992613],[43.275815,-5.992334],[43.275963,-5.991969],[43.276127,-5.991776],[43.276182,-5.991551],[43.27626,-5.991368],[43.276393,-5.991207],[43.276436,-5.991138],[43.27651,-5.990966],[43.276674,-5.990746],[43.27683,-5.990558],[43.276901,-5.990446],[43.276811,-5.990446],[43.276744,-5.990515],[43.276744,-5.990531],[43.276713,-5.990569],[43.27667,-5.990607],[43.276631,-5.990639],[43.276584,-5.990655],[43.276534,-5.99066],[43.276506,-5.990676],[43.276467,-5.990725],[43.27642,-5.9908],[43.276342,-5.990912],[43.27628,-5.990945],[43.276205,-5.99102],[43.276186,-5.9911],[43.276151,-5.991132],[43.276131,-5.991186],[43.276088,-5.991256],[43.276057,-5.991304],[43.27601,-5.9914],[43.275979